class Solution(object):
    def count(self, num1, num2, min_sum, max_sum):
        MOD = 10**9 + 7

        def dp(x, tight, sum_so_far, memo):
            if x == len(str_num): return min_sum <= sum_so_far <= max_sum
            if not tight and (x, sum_so_far) in memo: return memo[(x, sum_so_far)]
            end = int(str_num[x]) if tight else 9
            total = 0
            for digit in range(end + 1):
                total += dp(x + 1, tight and digit == end, sum_so_far + digit, memo)
            if not tight: memo[(x, sum_so_far)] = total
            return total

        def count_up_to(num):
            global str_num
            str_num = str(num)
            memo = {}
            return dp(0, True, 0, memo)

        num1, num2 = int(num1), int(num2)
        return (count_up_to(num2) - count_up_to(num1 - 1)) % MOD
